const AboutPage = () => (
    <React.Fragment>
    <h1>About the blog</h1>
    <p>This is a React built blog.</p>
    <p>I love React.js! React.js is amazing, and super useful and powerful!</p>
    </React.Fragment>
);

export default AboutPage;
